import React from "react";

const profile = () => {
  return (
    <div className='flex-col flex justify-center items-center'>
      <div className=' max-w-6xl w-full mt-16'>
          <a className="bg-red-400 text-white p rounded font-bold">Home</a>
        <div className=' grid-2-5 mt-4'>
          <div className='  flex flex-col justify-center items-center '>
            <div className="m-2">
            <img src="../logo.png" alt="profile picture" className="rounded border" />
            </div>
            <a href="" className="bg-white">Edit profile</a>
          </div>
          <div className=' bg-yellow-400 '>main</div>
        </div>
      </div>
    </div>
  );
};

export default profile;
